import React, { useEffect, useState } from 'react';
import { Button, Card, Col, Container, Image, Row } from 'react-bootstrap';
import bigStar from '../assets/star.png';
import { useParams } from 'react-router-dom';
import { fetchOneDevice } from '../http/deviceAPI';
import axios from 'axios';

const DevicePage = () => {
    const [device, setDevice] = useState({ info: [], rating: 0 });
    const [userRating, setUserRating] = useState(0);
    const { id } = useParams();
    const [showImageModal, setShowImageModal] = useState(false); // Модальное окно для изображения

    useEffect(() => {
        fetchOneDevice(id).then(data => {
            setDevice(data);
            setUserRating(data.userRating || 0); // Если пользователь уже поставил рейтинг
        });
    }, [id]);

    const handleRatingChange = (newRating) => {
        // Отправляем новый рейтинг на сервер
        axios.post('/api/rate', {
            userId: 1, // Текущий пользователь (в реальном приложении нужно будет получить ID из сессии)
            deviceId: id,
            newRating: newRating,
        })
            .then(response => {
                setUserRating(newRating); // Обновляем рейтинг пользователя
                setDevice(prevState => ({
                    ...prevState,
                    rating: response.data.newRating, // Обновляем средний рейтинг устройства
                }));
            })
            .catch(error => {
                console.error('Error updating rating:', error);
            });
    };

    return (
        <Container className="device-page-container mt-3">
            <Row>
                <Col md={4}>
                    <Image
                        className="device-image"
                        width={300}
                        height={300}
                        src={process.env.REACT_APP_API_URL + device.img}
                        alt={device.name}
                        onClick={() => setShowImageModal(true)} // Открытие модального окна при клике
                    />
                </Col>
                <Col md={4}>
                    <Row className="d-flex flex-column align-items-center">
                        <h2 className="device-title">{device.name}</h2>
                        <div
                            className="d-flex align-items-center justify-content-center"
                            style={{ background: `url(${bigStar}) no-repeat center center`, width: 240, height: 240, backgroundSize: 'cover', fontSize: 64 }}
                        >
                            {device.rating}
                        </div>
                        <div className="device-rating">
                            <h3>Ваш рейтинг:</h3>
                            {[1, 2, 3, 4, 5].map(rating => (
                                <Button
                                    key={rating}
                                    variant={userRating >= rating ? 'warning' : 'outline-warning'}
                                    onClick={() => handleRatingChange(rating)}
                                >
                                    {rating}
                                </Button>
                            ))}
                        </div>
                    </Row>
                </Col>
                <Col md={4}>
                    <Card className="device-price-card d-flex flex-column align-items-center justify-content-around">
                        <h3>От: {device.price} руб.</h3>
                        <Button variant={"outline-dark"}>Добавить в корзину</Button>
                    </Card>
                </Col>
            </Row>
            <Row className="device-info">
                <h1>Характеристики</h1>
                {device.info.map((info, index) => (
                    <Row key={info.id} className="info-row" style={{ background: index % 2 === 0 ? 'lightgray' : 'transparent' }}>
                        {info.title}: {info.description}
                    </Row>
                ))}
            </Row>

            {/* Модальное окно для увеличенного изображения */}
            {showImageModal && (
                <div className="image-modal" onClick={() => setShowImageModal(false)}>
                    <div className="modal-content">
                        <Image
                            src={process.env.REACT_APP_API_URL + device.img}
                            alt={device.name}
                            className="modal-image"
                        />
                    </div>
                </div>
            )}
        </Container>
    );
};

export default DevicePage;
